const Apartments = () => {
  const classes = useStyles();
  return (
    <>
      <Typography className={classes.title} variant={'h1'}>Our apartments</Typography>
      <Link to="/">return home</Link>
      <ApartmentsContainer />
    </>
  );
};

export default Apartments;
